const axios = require("axios");
const SERVER_IP = "http://127.0.0.1:8000/";

const utilities = {
  fetchBooks: async function () {
    await axios
      .get(SERVER_IP + "books")
      .then(function (response) {
        console.log(response.data)
        return response.data
      })
      .catch(function (error) {
        console.log(error);
      });
  },
};

export default utilities;
